import React from 'react';

class Home extends React.Component {

  constructor(props) {
    super(props);

    this.state = {
      searchText: "",
      searchResults: null,
    }
  }

  searchButtonClicked = () => {
    //make API request 

    const text = this.state.searchText.trim();

    fetch(`http://localhost:8080/api?searchText=${encodeURIComponent(this.state.searchText)}`, {
      method: 'GET'})
      .then((response) => {
        return response.json();
      })
      .then((json) => {

        console.log('JSON received');
        console.log(json);

        this.setState({
          searchResults: json.businesses
        });

      })
      .catch((error) => {

        console.log("There was an error: ");
        console.log(error);

      });
  }

  searchTextChanged = (event) => {
    this.setState({
      searchText: event.target.value
    });
  }

  render() {
    return(
      <div style={{padding: 20}}>

        <h1>AirGarage Homework Assignment</h1>

        <input 
          onChange={this.searchTextChanged}
          type="text"
          id="name"
          name="name"
          placeholder={"Enter Search Here"} 
          style={{height: 50, borderRadius: 5, fontSize: 18, marginRight: 15}}
        />

        <button 
          onClick={this.searchButtonClicked}
          style={{height: 50}}
        >Submit Search</button>


        <ul>
          <li>Test location</li>
        </ul>


      </div>



    );
  }
}

export default Home;
